import './Tours.css';
// import Tour from './Tour';
const data=[
    {image:'img',info:'Best Of Paris In 7 Days Tour',price:'$1,995',para:'P the er — in art, fashion "kh" '},
    {image:'img',info:'Best Of Ireland In 14 Days Tour',price:'$1,995',para:'P the er — in art, fashion "kh" '},
    {image:'img',info:'Best Of Salzburg & Vienna In 8 Days Tour',price:'$1,995',para:'P the er — in art, fashion "kh" '},
    {image:'img',info:'Best Of Rome In 7 Days Tour',price:'$1,995',para:'P the er — in art, fashion "kh" '},
    {image:'img',info:'Best Of Poland In 10 Days Tour',price:'$1,995',para:'P the er — in art, fashion "kh" '},
]

function Tours(props) {
    return (
        <div className='title'>
            <h1>Our Tours</h1>
            <h2>count: {props.count}</h2>
            <button onClick={props.decval}>Dec</button>
            <button onClick={props.incVal} >Inc </button>
            
            <div className='underline'></div> 
            {data.map((val, index) => {
                return <Tour data={val} key={index} />
            })} 
            </div>

       
    )
}

export default Tours;
